  try {
    await fetch(`${apiEntradas}`, {
      method: 'PUT',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(entrada),
    })
    .then(()=> alert('entrada editado com sucesso!'))
  } catch (error) {
