  try {
    await fetch(`${apiAnimais}`, {
      method: 'PUT',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(animal),
    })
    .then(()=> alert('animal editado com sucesso!'))
  } catch (error) {
    console.log('Erro na requisição:', error);
  }
}

export async function excluirAnimais(id) {
  try {
    await fetch(`${apiAnimais}`, {
      method: "DELETE",
      headers: {
        "Content-Type": "application/json",
      },
